INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (3001, 1, 1, 9, 1, "まあまあな点数だけど、\n自分的に手ごたえはどう？\nダメだって思ってんなら、\nまだまだ伸びる余地ありね！", 12300148, 0, "vo_minigame_1012_result_1080", 2, 0.0, 1, 5);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (3001, 1, 8, 9, 1, "うん、中々の出来ね！\nでもあんたはもっといい点\n取れるはずよ！\nもっと頑張りましょうか！", 12300149, 0, "vo_minigame_1012_result_1081", 2, 2.21, 2, 5);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (3001, 1, 3, 9, 1, "ん～はっきり言って微妙ね！\nま、難しい問題だし、\n勉強すれば\n点数は上がっていくと思うわ！", 12300150, 0, "vo_minigame_1012_result_1082", 2, 2.46, 2, 5);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (3001, 1, 3, 9, 1, "ん～…\n10点には届かなかったか～\n次は10点越え目指して\n頑張ってみない？", 12300151, 0, "vo_minigame_1012_result_1083", 2, 2.94, 2, 5);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (3001, 1, 7, 9, 1, "はいお疲れ～\n点数的にはまあまあってとこね！\nま、超難問だし頑張ったわよ", 12300152, 0, "vo_minigame_1012_result_1084", 2, 4.19, 3, 5);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (3001, 1, 1, 9, 1, "うん、かなり難しい問題なのに\n最後までやり遂げたわね\n次はもっといい点目指してみる？", 12300153, 0, "vo_minigame_1012_result_1085", 2, 0.0, 3, 5);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (3001, 1, 3, 9, 1, "ちょっとミスが多かったかもね～\nでも間違えた所は復習して\n次は正解するわよー！", 12300154, 0, "vo_minigame_1012_result_1086", 2, 2.63, 3, 5);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (3001, 1, 3, 4, 1, "あら…あんまり良くない点数ね～\nどうしたの、調子でも悪かった？\n次はもっと頑張りましょうか", 12300155, 0, "vo_minigame_1012_result_1087", 2, 5.53, 1, 1);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (3001, 1, 3, 4, 3, "ん～…正解数は\n物足りないわね～\nもうちょっと勉強の時間\n増やしちゃおっか？", 12300156, 9, "vo_minigame_1012_result_1088", 2, 0.01, 1, 1);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (3001, 1, 3, 4, 1, "ん～…あんたならもうちょと\nいい点取れんでしょ～？\nもっと頑張んなさいよ\n期待してやってんだからさ！", 12300157, 3, "vo_minigame_1012_result_1089", 2, 4.15, 1, 1);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (3001, 1, 9, 4, 9, "ん～今のあんたには、\nこの問題は難しかったかしら…\n難易度下げてチャレンジするのも\nありかもね～？", 12300158, 9, "vo_minigame_1012_result_1090", 2, 0.01, 2, 1);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (3001, 1, 3, 4, 1, "あんまり出来は良くないわね～\n難しい問題だししょうがないけど\n次はもっと頑張ってほしいわ！", 12300159, 0, "vo_minigame_1012_result_1091", 2, 5.37, 2, 1);
