INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (3001, 1, 5, 0, 3, "あらら…０点よ\nま、難しい問題だしね…\n…つっても０点は無いわ！\n一問くらい正解しなさいよ！", 12300170, 1, "vo_minigame_1012_result_1102", 2, 5.32, 3, 0);
