INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (3001, 2, 4, 4, 10, "覚えても、すぐ忘れるんだけど\nどしたらいい？\nあ、そーゆうとき\nフクシューする感じ？", 22300160, 3, "vo_minigame_1012_result_2092", 2, 4.29, 2, 1);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (3001, 2, 4, 4, 8, "ムズ過ぎ！\n頭パンクするかと思った…！\nヒデサイ、うちの頭\nふぅふぅして～", 22300161, 6, "vo_minigame_1012_result_2093", 2, 4.64, 3, 1);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (3001, 2, 9, 4, 5, "おにムズ過ぎてテンサゲ～\nでもヒデサイがんばってるし\nうちもがんばる！", 22300162, 0, "vo_minigame_1012_result_2094", 2, 3.14, 3, 1);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (3001, 2, 7, 4, 4, "ヒデサイと同じ点数で\nちょっち安心したかも\n一緒にがんばろーね！\n置いてっちゃやだよ？", 22300163, 0, "vo_minigame_1012_result_2095", 2, 6.59, 3, 1);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (3001, 2, 3, 0, 3, "…まあ、これより下はないし\n次は大逆転\n点数爆上がりっしょ！", 22300164, 0, "vo_minigame_1012_result_2096", 2, 0.0, 1, 0);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (3001, 2, 9, 0, 10, "０点じゃん…\nそだ、次はえんぴつ転がして\n選ぶ作戦やってみる？", 22300165, 5, "vo_minigame_1012_result_2097", 2, 2.2, 1, 0);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (3001, 2, 4, 0, 4, "考えるの無理な時あるよね…\nヒデサイもそーゆう\n感じだったの？", 22300166, 6, "vo_minigame_1012_result_2098", 2, 0.01, 1, 0);
