INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (3001, 2, 9, 0, 4, "むむむ～…０点…！\n覚えてもすぐ忘れちゃうし\nベンキョーってマジ大変", 22300168, 6, "vo_minigame_1012_result_2100", 2, 3.22, 2, 0);
