INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (3001, 2, 0, 0, 2, "おやつ休憩して\nリベンジしよっ！\n甘いの食べたら、イケるっしょ！", 22300170, 3, "vo_minigame_1012_result_2102", 2, 2.74, 3, 0);
